private static boolean isStarImport(DetailAST importAst)
{
    boolean result = false;
    DetailAST toVisit = importAst;
    while (toVisit != null) {
        toVisit = getNextSubTreeNode(toVisit, importAst);
        if (toVisit != null && toVisit.getType() == TokenTypes.STAR) {
            result = true;
            break;
        }
    }
    return result;
}
